import React from "react";
import "../styles/Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div className="socialMedia">
        <p>Instagram | Twitter | Facebook | LinkedIn </p>
      </div>
      <p> &copy; 2022 LEMProperties.ph</p>
    </div>
  );
}

export default Footer;
